css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.terracaching.com") {
body
{
	background-color:#000!important;
}
body h1
{
       color:darkred!important;
}
table,th,td
{
	border-style:none!important;
}

font[color='#000000'],th,td,p
{
	color:#afafaf!important;
}

input, textarea, select {
	background-color:#333!important;
	color:#afafaf!important;
	border-color:#000!important;
}

a:link,a:active,a:visited
{
	color:#f70!important;
	text-decoration:none!important;
}
a:hover
{
	text-decoration:underline!important;
}

hr
{
	height:0!important;
	border:solid #000 0!important;
	border-top-width:1px!important;
}

td .spaceRow
{
	display:none!important;
	height:0!important;
}


.bodyline
{
	background-color:#000!important;
}

.copyright
{
	color:#CCC!important;
}

.main-background,.forumline
{
	-moz-border-radius:6px!important;
}

th
{
	background-color:#000!important;
}

.thHead .row1
{
	background-color:transparent!important;
	border:2px solid #B72B01!important;
	-moz-border-radius:6px!important;
}

.postdetails
{
	font-size:10px;
	color:#a0a0a0!important;
}

.forumlink
{
	color:#f70!important;
}

.name
{
	color:#ccc!important;
}

.quote
{
	background-color:#444!important;
	color:#CCC!important;
	-moz-border-radius:2px!important;
}

.quote .quote
{
	border-color:#000!important;
	border-style:solid!important;
}

.code
{
	background-color:#333!important;
	color:#CCC!important;
	border-color:#000!important;
	border-style:solid!important;
}

.row3Right
{
	background-color:#222!important;
}

.udm a,.udm a:link,.udm a.nohref
{
	background-color:#000!important;
	color:#f70!important;
	border-style:none!important;
 -moz-border-radius:8px!important;
}

.udm a:hover
{
	text-decoration:none!important;
	background-color:#222!important;
-moz-border-radius:4px!important;
}

#udm>li ul{
 -moz-border-radius:5px!important;
}

.udm ul
{
	background-color:#000!important;
	opacity:.8;
	border-color:#000!important;
	border-style:hidden!important;
}

.gen,.genmed,.gensmall,.gentiny,.genlarge,.topictitle b,.navsmall,.nav
{
	color:#afafaf!important;
}

td.row1,tr.row1
{
	background-color:#111!important;
}
input[type="submit"]
{
	cursor:pointer;
}
input.row1,input.row2
{
	background-color:red!important;
	border:0;
}

td.row2,tr.row2
{
	background-color:#222!important;
}

td.row3,tr.row3
{
	background-color:#333!important;
}
td.catBottom {
background-color: #336699!important;
}
img[class="udmA"][src="/udm-resources/down-arrow.gif"]
{
display:none!important;
}

.gensmall .highlight
{
        color:transparent!important;
        vertical-align:middle!important;
	width:12px!important;
	height:12px!important;
	padding-left:0px!important;
        margin-right:2px!important;
        background-repeat:no-repeat!important;
        background-image:url("data:image/png;base64,")!important;
}

img[src="/images/logo-final.jpg"]
{
	width:0!important;
	height:65px!important;
	padding-left:350px!important;
	background-image:url("data:image/png;base64,")!important;
}
a[href="javascript:getOption('BADGE_DESCRIPTIONS','');"]{
float:left!important;
}
}

@-moz-document url(http://www.terracaching.com/) {
td.gensmall {
background-color:#222!important;
}
}

@-moz-document url-prefix(http://www.terracaching.com/viewcache.cgi?ID=) {
body {
font-family:Times!important;
color:#afafaf!important;
}
body[vlink] {
font-family:verdana !important;
}
}

@-moz-document url-prefix(http://www.terracaching.com/viewcache.cgi?ID=notused) {
body {
font-family:Times!important;
background-color:#FFF!important;
color:#000!important;
font-size:11px!important;
}

font,th,td,p {
color:#000!important;
background-color:#FFF!important;
}

h1,h2,h3,h4,h5,h6 {
font-family:"Lucida Grande", "Lucida Sans", "Lucida Sans Unicode", "Lucida", Verdana, "Bitstream Vera Sans", sans-serif;
page-break-after:avoid;
margin:.75em 0 .5em;
}

.gen {
color:#000!important;
font-size:smaller!important;
}

td {
border-top:1px solid #000!important;
}

.row2 td {
border-top:none!important;
}
}
